import React from 'react';
import '../assets/styles/Home.css';

const Home = () => {
    return (
        <div className="home-container">
            <div className="home-content">
                <h1>Welcome to DAAVI SPECIAL</h1>
                <p>Experience the best online delivery food restaurant.</p>
            </div>
        </div>
    );
};

export default Home;
